import reportWebVitals from './reportWebVitals';
import DataProvider from './redux/store';
import { BrowserRouter } from 'react-router-dom';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <BrowserRouter>
    <React.StrictMode>
      <DataProvider>
        <h1>Hii</h1>
      </DataProvider>
    </React.StrictMode>
  </BrowserRouter>
);
